import React from "react";
import { FaHome, FaFileAlt, FaAlignLeft, FaGithub } from "react-icons/fa";

const Navbar = () => {
  return (
    <div className="absolute z-10 w-screen h-[80px] bg-yellow flex justify-center">
      <div className="w-[80%]  items-center flex justify-center grid grid-cols-2">
        <div className="flex w-full h-full justify-start">
          <div className="flex items-center">
            {" "}
            <FaGithub />{" "}
          </div>
        </div>
        <div className="flex  w-full h-full justify-end items-center">
          <div className="w-[5%] flex justify-center">
            {" "}
            <FaHome size={25} className="cursor-pointer text-dark" />{" "}
          </div>
          <div className="w-[5%] flex justify-center">
            {" "}
            <FaAlignLeft size={25} className="cursor-pointer text-dark" />{" "}
          </div>
          <div className="w-[5%] flex justify-center">
            {" "}
            <FaFileAlt size={25} className="cursor-pointer text-dark" />{" "}
          </div>
        </div>
      </div>
    </div>
  );
};

export default Navbar;
